schemaDefinition: "create or replace view CLICK_EMAIL(\n\tID,\n\t\"MarketoGUID\",\n\
  \t\"LeadID\",\n\t\"ActivityDate\",\n\t\"ActivityTypeID\",\n\t\"PrimaryAttributeValueID\"\
  ,\n\t\"PrimaryAttributeValue\",\n\t\"CampaignID\",\n\t\"Campaign\",\n\t\"CampaignRunID\"\
  ,\n\t\"ChoiceNumber\",\n\t\"Device\",\n\t\"MobileDivice\",\n\t\"CampaignHasPredective\"\
  ,\n\t\"Link\",\n\t\"Platform\",\n\t\"StepID\",\n\t\"UserAgent\",\n\t\"ETLInsetDate\"\
  ,\n\t\"ETLUpdateDate\",\n\t\"ETLDeleteDate\",\n\t\"LinkType\"\n) as\n SELECT \"\
  ID\" as \"ID\",\n\"MARKETOGUID\" as \"MarketoGUID\",\n\"LEADID\" as \"LeadID\",\n\
  \"ACTIVITYDATE\" as \"ActivityDate\",\n\"ACTIVITYTYPEID\" as \"ActivityTypeID\"\
  ,\n\"PRIMARYATTRIBUTEVALUEID\" as \"PrimaryAttributeValueID\",\n\"PRIMARYATTRIBUTEVALUE\"\
  \ as \"PrimaryAttributeValue\",\n\"CAMPAIGNID\" as \"CampaignID\",\n\"CAMPAIGN\"\
  \ as \"Campaign\",\n\"CAMPAIGN_RUN_ID\" as \"CampaignRunID\",\n\"CHOICE_NUMBER\"\
  \ as \"ChoiceNumber\",\n\"DEVICE\" as \"Device\",\n\"IS_MOBILE_DEVICE\" as \"MobileDivice\"\
  ,\n\"HAS_PREDECTIVE\" as \"CampaignHasPredective\",\n\"LINK\" as \"Link\",\n\"PLATFORM\"\
  \ as \"Platform\",\n\"STEP_ID\" as \"StepID\",\n\"USER_AGENT\" as \"UserAgent\"\
  ,\n\"ETL_INSERT_DATE\" as \"ETLInsetDate\",\n\"ETL_UPDATE_DATE\" as \"ETLUpdateDate\"\
  ,\n\"ETL_DELETE_DATE\" as \"ETLDeleteDate\",\n        CASE WHEN contains(LINK, 'random')\
  \ then 'random'\n              WHEN contains(LINK, 'random') then 'random'\n   \
  \           WHEN contains(LINK, 'random') then 'random' else 'random' end \"LinkType\"\
  \n   FROM \"RDS\".\"MARKETO\".\"CLICK_EMAIL\";"
